const startGame = () => {
	// Check for a stored game
	word = localStorage.getItem(lang + level + 'word');
	if (localStorage.getItem(lang + level + 'gameover') == 'No') {
		gameOver = false;
	} else {
		gameOver = true;
	};
	if (word == null || gameOver) {
		//Start new game
		reset();
		generateWord();
	} else {
			//Load previous game
			col = 0;
			hintsUsed = parseInt(localStorage.getItem(lang + level + 'hints'));
			for (let i = 0; i < height; i++) {
				guesses[i] = localStorage.getItem(lang + level + 'guess' + i.toString());
				if (guesses[i] == null) {
					row = i;
					//If there are no guesses, Hint button is not available
					if (row == 0) {
						invalidate('Hint');
					} else {
						validate('Hint');
					}
					break;
				} else {
					//Repopulate guesses into the board
					writeWord(guesses[i], i);
					writeResult(calculate(guesses[i], word), i);
					invalidateLetters(i);
				}
			}
    }
};

const reset = () => {
	//Reset game board
	for (let i = 0; i < Math.min(row + 1, height); i++) {
		for (let j = 0; j < width + 3; j++) {
			let currTile = document.getElementById(i.toString() + '-' + j.toString());
			currTile.innerText = '';
			if (j < width) {
				//Remove styles from left side of game board
				currTile.classList.remove('flip');
				if (currTile.classList.contains('red')) {
					currTile.classList.remove('red')
				};
				if (currTile.classList.contains('yellow')) {
					currTile.classList.remove('yellow')
				};
				if (currTile.classList.contains('green')) {
					currTile.classList.remove('green')
				}
			}
		}
	};
	    //Reset virtual keyboard
		keys.forEach(key => {
		if (key == 'Enter' || key == 'Hint' || key == 'Back') {
           invalidate(key);
		} else {
           validate(key);
		}
		});

	//Remove potential striked out letters from current row
	for (let i = 0; i < width; i++) {
		let square = document.getElementById(row.toString() + '-' + i.toString());
		square.classList.remove('invalidWord');
		square.classList.add('validWord');
	};

	//Rest of the variables.
	row = 0;
	col = 0;
	gameOver = false;
	hintsUsed = 0;
	guesses = ['', '', '', '', '', '', '', '', '', ''];
	invalidate('Enter');
	invalidate('Hint');
	invalidate('Back');
	//Invalidate unusual letters if level = Standard
	if (level !== 'A') {
		exclude.forEach(char => {
			validate(char);
		});
	};
};

const generateWord = () => {
	word = words[Math.ceil(words.length * Math.random())];
	localStorage.setItem(lang + level + 'word', word);
	localStorage.setItem(lang + level + 'hints', '0');
	localStorage.setItem(lang + level + 'gameover', 'No');
	//Delete previous guesses from localStorage
	for (let i = 0; i < height; i++) {
		localStorage.removeItem(lang + level + 'guess' + i.toString());
	}
};

const handleClick = (letter) => {
	//Move focus to ENTER button
	document.getElementById('Enter').focus();

	if (!gameOver) {
		if (letter == 'Back') {
			deleteLetter();
			return;
		};
		if (letter == 'Hint') {
			if (row > 0) {
				if (hintsUsed == 0) {
					let answer = confirm('This will generate a random word, that fits your previous guesses.\r\nThe game will count as a loss and your streak resets to 0!\r\nDo you want to proceed, oh lazy one?');
					if (!answer) {
						return;
					};
				};
				guesses[row] = generateHint();
				writeWord(guesses[row], row);
				col = 5;
				processEnter();
				hintsUsed += 1;
				localStorage.setItem(lang + level + 'hints', hintsUsed.toString());
			}
			return;
		};
		if (letter == 'Enter') {
			//alert(readWord());
			processEnter();
			return;
		};
		if (letter == 'Spec') {
			addLetter(document.getElementById('Spec').textContent);
			return;
		};
		if (letter == 'US') {
			addLetter('_');
			return;
		};
		addLetter(letter);
	}
};

const addLetter = (letter) => {
	if (col < width) {
        let tile = document.getElementById(row.toString() + '-' + col.toString());
        if (tile.innerText == '') {
            tile.innerText = letter;
            col += 1;
			if (col==1) {
				validate('Back');
			}
			//Do we have a complete word?
			if (col==width) {
				let guess = readWord();
				if (guess.includes('_')) {
					return;
				};
				if (!validWord(guess)) {
			       for (let i = 0; i < width; i++) {
				      let tile = document.getElementById(row.toString() + '-' + i.toString());
				      tile.classList.remove('validWord');
                      tile.classList.add('invalidWord');
			       }
				} else {
					validate('Enter');
				}
			}
        }
    }
};

